import requests
from json import loads,dumps

Url = 'http://seat.lib.whu.edu.cn/'

def getToken(Username,Password):
    print(Username,Password)
    url = Url+'/rest/auth?username=%s&password=%s' % (Username,Password)
    print(url)
    res = requests.get(Url+'/rest/auth?username=%s&password=%s' % (Username,Password))
    return loads(res.text)['data']['token']

def getRoom(Token,building_id):
    res = requests.get(Url+'/rest/v2/room/stats2/%s?token=%s' % (building_id,Token))
    return loads(res.text)['data']

def getSeat(Token,room_id,book_time):
    res = requests.get(Url+'/rest/v2/room/layoutByDate/%s/%s?token=%s' % (room_id,book_time,Token))
    return loads(res.text)['data']['layout']

def getSeatid(seat_num,seats):
    for i in seats:
        #print(i['name'])
        if i['name']==seat_num:
            return str(i['id'])
    return 0

def getTimeid(time):
    for i in Times:
        if i['value']==time[0:5]:
            return i['id']
    return 0

def getFreetime(Token,seat,book_time):
    res = requests.get(Url+'/rest/v2/startTimesForSeat/%s/%s?token=%s' % (seat,book_time,Token))
    return loads(res.text)['data']['startTimes']

def getEndtime(Token,seat,book_time,start_time):
    res = requests.get(Url+'/rest/v2/endTimesForSeat/%s/%s/%s?token=%s' % (seat,book_time,start_time,Token))
    return loads(res.text)['data']['endTimes']

def bookSeat(Token,StartTime,EndTime,Seat,Date):
    post_value = {
        'token':Token,
        'startTime':StartTime,
        'endTime':EndTime,
        'seat':Seat,
        'date':Date
    }
    print(post_value)
    try:
        res = requests.post(Url+"/rest/v2/freeBook", data=post_value,timeout=3)
    except:
        res = {'status':'fail','message':'连接出现问题....'}
    if type(res) == requests.models.Response:
        return loads(res.text)
    else:
        return res

